import { fetchArticles } from '../modules/ArticleList'


class ArticlesList extends React.Component {

  constructor(props) {
    super(props);
    this.state = {
      data: {}
    };
  }
  getUsersData() {
    axios.get('/api/v1/articles',{})
    .then(res => {
      const data = res.data
      console.log(data)
    }).catch(error => {
      console.log(error)
    })
  }

  componentDidMount(){
    this.getUsersData()
  }

  render(){
    return (
      <div></div>
    )
  }
}

function mapStateToProps(state) {
  // const articleListState = state.articles
